function Legend(){
    return(
        <div>
        <p> 3: Perfect pass, can set middle</p>  
        <p> 2: Good pass, can set pins but not middle</p>  
        <p> 1: Bad pass, Out of System / Overpass</p>  
        <p> 0: Aced </p>  
        </div>
    )
}
export default Legend()
